import {BrowserRouter, Switch, Route} from 'react-router-dom';
import './App.css';
import InfoLogin from './containers/Login';
import InfoSingin from './containers/Singin';
import HomeContainer from './containers/HomeContainer';
import ProductsContainer from './containers/ProductsContainer';
import { EcommerceProvider } from './context/EcommerceContext';
import UserCont from './containers/UserContainer';
import NewProductContainer from './containers/NewProductContainer';
import ForgetPassContain from './containers/ForgetPassContainer';
import DeleteContainer from './containers/DeleteContainer';






const App= () => {
  return (
    <div className="App">
      <BrowserRouter>
      <EcommerceProvider>
      <Switch>
        <Route exact path="/productos">
          <ProductsContainer/>
        </Route>
        <Route path="/productos/:busqueda">
          <ProductsContainer/>
        </Route>
        <Route path="/login">
          <InfoLogin/>
        </Route> 
        <Route path="/singin">
          <InfoSingin/>
        </Route>
        <Route exact path="/">
          <HomeContainer/>
        </Route>
        <Route path="/home">
          <HomeContainer/>
        </Route>
        <Route path="/forget">
        <ForgetPassContain/>
        </Route>
        <Route path="/newproduct">
          <NewProductContainer/>
        </Route>
        <Route path="/user">
          <UserCont/>
        </Route>
      </Switch>
      
      </EcommerceProvider>
      </BrowserRouter>
    </div>
  );
}

export default App;
